script: |
  super -f text -I q9675.spq | sort > q9675.out

inputs:
  - name: q9675.spq
    data: |
      SELECT DISTINCT - 16 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor2, tab0 (FORMAT parquet);
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q9675.out
    data: |
      -16
